import React from 'react';

function Header(props){
    return (
        <div>
            <h1>{props.name} Editor</h1>
            <ul>
                {props.list.map( (dish) => (<li key={dish.id}>
                    {dish.dish}
                </li>))}
            </ul>
        </div>    
    );
}

function testingCondition(props){
    return (
    <>
    {props.condition ? <h1>King</h1> : <h1>Don</h1>}
    </>    )
}

export default {Header,testingCondition};
